import React from 'react';
import axios from 'axios';
import Timeslot from './Timeslot';

class Expanded extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            numberOfKills: null,
            shipSelected: null
        };
    }
    componentDidMount = () => {
        axios.get(`/api/esi/${this.props.name}/${this.state.shipSelected}/`)
            .then(response => {
                return this.setState({numberOfKills: response.data.parsedData})
            })
    };
    render(){
            return (
                <div>
                    <ul>
                        <h1>{this.props.name}</h1>
                        <Timeslot between = '00:00 - 02:59'/>
                        <h1></h1>
                        <Timeslot between = '03:00 - 05:59'/>
                        <h1></h1>
                        <Timeslot between = '06:00 - 08:59'/>
                        <h1></h1>
                        <Timeslot between = '09:00 - 11:59'/>
                        <h1></h1>
                        <Timeslot between = '12:00 - 14:59'/>
                        <h1></h1>
                        <Timeslot between = '15:00 - 17:59'/>
                        <h1></h1>
                        <Timeslot between = '18:00 - 20:59'/>
                        <h1></h1>
                        <Timeslot between = '21:00 - 23:59'/>
                        <h1></h1>
                    </ul>
                </div>
            )
    }
};

export default Expanded;
